import React from "react";
import { Outlet, Link } from "react-router-dom";

export default function Layout() {
  return (
    <div style={{}}>
        <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>

          <li>
            <Link to="/about">About</Link>
          </li>

          <li>
            <Link to="/contact">Contcat</Link>
          </li>
        </ul>
        </nav>
      <Outlet />
    </div>
  );
}
